import React from 'react';
import './Header.css';
import carLogo from './images/auto_car-16.png'; // Import your car logo

function Header() {
  return (
    <header className="header">
      <div className="logo-container">
        <img src={carLogo} alt="vozilo.si" className="logo-image" draggable="false" />
        <span className="logo-text">vozilo.si</span>
      </div>
      <nav className="nav-links">
        <a href="/buy" className="nav-link" style={{ color: '#ffba3a' }}>Buy</a> {/* Inline style */}
        <div className="divider"></div> {/* Divider between links */}
        <a href="/sell" className="nav-link" style={{ color: '#ffba3a' }}>Sell</a> {/* Inline style */}
        <div className="divider"></div>
        <a href="/info" className="nav-link" style={{ color: '#ffba3a' }}>Info</a> {/* Inline style */}
      </nav>
      <div className="register-button">
        <a href="/register" className="register-link" style={{ backgroundColor: '#d3ff0e', color: 'black' }}>Register</a> {/* Inline style */}
      </div>
    </header>
  );
}

export default Header;
